import React from "react";
import Calendar from '../components/Calendar';
import ContactPage from '../components/ContactPage';
import NonBusiness from '../components/nonbusinessenquires';
import { useTranslation } from 'react-i18next';

function Contact() {
    const { t } = useTranslation();

    return (
        <div style={styles.container}>
            {/* ContactPage at the top */}
            <ContactPage />

            {/* Container for Calendar and NonBusiness */}
            <div style={styles.halfContainer}>
                <Calendar />
                <NonBusiness />
            </div>
        </div>
    );
}

// Styles for the component
const styles = {
    container: {
        display: 'flex',
        flexDirection: 'column', // Stack children vertically
        minHeight: '100vh', // Ensure the container takes the full viewport height
    },
    halfContainer: {
        display: 'flex',
        flex: 1, // Take up the remaining half of the screen
        justifyContent: 'space-between', // Space between Calendar and NonBusiness
        alignItems: 'center', // Center vertically
        gap: '20px', // Add spacing between the components
        padding: '20px', // Add padding
        backgroundColor: '#f9f9f9', // Optional: Add a background color
    },
};

export default Contact;
